    setgraph(type) {
        this.chartdata = null;
        var lblmessage = "";
        if (type == "Receive") {
            lblmessage = "Receipts received  in past seven days.";
        }
        if (type == "Quality") {
            lblmessage = "Quality checked of materials  in past seven days.";
        }
        if (type == "Accept") {
            lblmessage = "Receipts accepted  in past seven days.";
        }
        if (type == "Putaway") {
            lblmessage = "materials put away in past seven days.";
        }
        var pid = [];
        var count = [];
        var gdata = this.dashboardgraphmodel.filter(function (elementx, index) {
            return (elementx.type == type);
        });
        if (gdata.length > 0) {
            gdata.forEach(element => {
                var showdate = this.datePipe.transform(element.graphdate, 'dd/MM/yyyy');
                pid.push(showdate);
                count.push(element.count);
            });
        }
        this.chartdata = {
            labels: pid,
            datasets: [
                {
                    label: lblmessage,
                    //backgroundColor: '#42A5F5',
                    backgroundColor: 'rgba(0,255,0,0.5)',
                    borderColor: '#7CB342',
                    data: count
                },
            ]
        };
        this.chartoptions = { scales: { yAxes: [{ ticks: { beginAtZero: true, userCallback: function (label, index, labels) { if (Math.floor(label) === label) {
                                return label;
                            } }, } }] } };
    }
    setmonthlygraph(type) {
        this.monthlychartdata = null;
        var lblmessage = "";
        if (type == "Receive") {
            lblmessage = "Monthly Received Receipts";
        }
        if (type == "Quality") {
            lblmessage = "Monthly Quality checked";
        }
        if (type == "Accept") {
            lblmessage = "Monthly Accepted Receipts";
        }
        if (type == "Putaway") {
            lblmessage = "Monthly put aways";
        }
        var pid = [];
        var count = [];
        var gdata = this.monthlydashboardgraphmodel.filter(function (elementx, index) {
            return (elementx.type == type);
        });
        if (gdata.length > 0) {
            gdata.forEach(element => {
                pid.push(element.smonth);
                count.push(element.count);
            });
        }
        this.monthlychartdata = {
            labels: pid,
            datasets: [
                {
                    label: lblmessage,
                    //backgroundColor: '#42A5F5',
                    backgroundColor: '#4BC0C0',
                    borderColor: '#7CB342',
                    data: count
                },
            ]
        };
        this.chartoptions1 = { scales: { yAxes: [{ ticks: { beginAtZero: true, userCallback: function (label, index, labels) { if (Math.floor(label) === label) {
                                return label;
                            } }, } }] } };
    }
