        let node;
        if (event.target.tagName === "IMG" || event.target.tagName === "SPAN") {
            node = event.target.parentNode;
        }
        else {
            node = event.target;
        }
        this.nodes = [];
        this.nodes.push(node);
        node.classList.add("cardactive");
        if (type != "") {
            sessionStorage.setItem("userdashboardpage", type);
        }
